import React, { useState } from "react";
import { predictDropout } from "../services/api";
import PredictionResult from "./PredictionResult";
import "bootstrap/dist/css/bootstrap.min.css";

export default function StudentForm() {
  const [formData, setFormData] = useState({
    marks_10: "",
    marks_11: "",
    marks_12: "",
    family_income: "",
    family_members: "",
    academic_score: "",
    motivation_level: "",
    attendance_rate: "",
    district: "",
    school_type_10: "Government",
    school_type_11: "Government",
    school_type_12: "Private",
    orphan: "No",
    single_parent: "No",
    girl_child: "No",
    siblings: "No",
    siblings_details: "None",
    rent_or_own: "Rent",
    property_owned: "No",
    willing_hostel: "Yes",
    any_scholarship: "No",
    communication_frequency: "Medium",
    family_support: "Medium",
    extra_curricular: "Yes"
  });

  const [result, setResult] = useState(null);
  const [loading, setLoading] = useState(false);

  const handleChange = (e) => {
    setFormData({ ...formData, [e.target.name]: e.target.value });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    setLoading(true);
    try {
      const data = await predictDropout(formData);
      setResult(data);
    } catch (error) {
      alert("Error connecting to backend. Make sure Spring Boot and Flask are running!");
    } finally {
      setLoading(false);
    }
  };

  return (
    <div className="container mt-5">
      <div className="card shadow p-4">
        <h2 className="text-center text-primary mb-4">ðŸŽ“ Maatram DeserveIQ â€” Dropout Predictor</h2>
        <form onSubmit={handleSubmit}>
          <div className="row">
            <div className="col-md-6 mb-3">
              <label>10th Marks</label>
              <input type="number" name="marks_10" value={formData.marks_10} onChange={handleChange} className="form-control" required />
            </div>
            <div className="col-md-6 mb-3">
              <label>11th Marks</label>
              <input type="number" name="marks_11" value={formData.marks_11} onChange={handleChange} className="form-control" required />
            </div>
            <div className="col-md-6 mb-3">
              <label>12th Marks</label>
              <input type="number" name="marks_12" value={formData.marks_12} onChange={handleChange} className="form-control" required />
            </div>
            <div className="col-md-6 mb-3">
              <label>Family Income (â‚¹)</label>
              <input type="number" name="family_income" value={formData.family_income} onChange={handleChange} className="form-control" required />
            </div>
            <div className="col-md-6 mb-3">
              <label>Academic Score</label>
              <input type="number" name="academic_score" value={formData.academic_score} onChange={handleChange} className="form-control" required />
            </div>
            <div className="col-md-6 mb-3">
              <label>Motivation Level (1â€“5)</label>
              <input type="number" name="motivation_level" value={formData.motivation_level} onChange={handleChange} className="form-control" required />
            </div>
            <div className="col-md-6 mb-3">
              <label>Attendance Rate (%)</label>
              <input type="number" name="attendance_rate" value={formData.attendance_rate} onChange={handleChange} className="form-control" required />
            </div>
            <div className="col-md-6 mb-3">
              <label>District</label>
              <input type="text" name="district" value={formData.district} onChange={handleChange} className="form-control" required />
            </div>
          </div>
          <button type="submit" className="btn btn-primary w-100" disabled={loading}>
            {loading ? "Predicting..." : "Predict Dropout Likelihood"}
          </button>
        </form>
      </div>

      {result && <PredictionResult result={result} />}
    </div>
  );
}
